import React from 'react'
import './styles/card.css'
import { Player } from "../";
import { image } from '../movies';



export default function Card(image) {
    
    
    
    return (
        
            
                <div className ="card">
                    <div className="cardImage">
                        <img src={image}/>
                    </div> 
                    

                        
                </div>    
            
            

        

        
    )
}
